import React from "react";
import logo from "./images/light-logo.png";
import logo1 from "./images/light.png";
import folder from "./images/uploadIconLight.png";
import SettingsOutlinedIcon from "@mui/icons-material/SettingsOutlined";
import { Button, Grid, Typography } from "@mui/material";
function Signin() {
  return (
    <div>
      {" "}
      <Grid style={{ marginLeft: "5Opx" }}>
        <img style={{ width: "200px", height: "30px" }} src={logo} alt="logo" />
        <SettingsOutlinedIcon style={{ margin: "5px", marginLeft: "20px" }} />
      </Grid>
      <Typography style={{ padding: "10px" }}>Ready when you are</Typography>
      <Grid style={{ display: "flex", justifyContent: "space-evenly" }}>
        <Button
          style={{
            backgroundColor: "rgb(88 28 135)",
            color: "white",
            width: "150px",
            borderRadius: "20px",
          }}
        >
          SESSION{" "}
        </Button>
        <Button
          style={{
            backgroundColor: "rgb(88 28 135)",
            border: "1px solid black",
            color: "white",
            width: "150px",
            borderRadius: "20px",
          }}
        >
          PREVIEW
        </Button>
      </Grid>
      <Grid style={{ display:"flex", }}>
        <Button
          style={{
            border: "0",
            background: "rgb(255, 255, 255)",
            width: "150px",
            height: "150px",
            transform: "rotate(45deg)",
            margin: "50px auto",
            borderRadius: "20px",
            padding: "20px",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            justifyContent: "center",
            transition: "all 0.3s cubic-bezier(0, 0, 0.5, 1) 0s",
            position: "relative",
          }}
        >
          <div style={{ transform: "rotate(-45deg)" }}>
            <img
              style={{
                marginTop: "auto",
                marginBottom: "auto",
                height: "60px",
              }}
              src={logo1}
              alt="logo"
            />
            <span
              style={{
                fontSize: "20px",
                textTransform: "uppercase",
                color: "rgb(100, 64, 189)",
                marginTop: "10px",
              }}
            >
              Firac
            </span>
          
          </div>
        </Button>
        <img
              style={{
               
              marginLeft: "230px",
                height: "60px",
                marginBottom:"200px"
              }}
              src={folder}
              alt="logo"
            />
      </Grid>
    </div>
  );
}

export default Signin;
